I can provide you with the structure of the end user api for 3d camera animation in typescript that can be used to create a user interface for controlling camera movements. Here is a sample code snippet to get you started:

```
interface cameraoptions {
  position: vec3;
  rotation: vec3;
  speed: number;
  sensitivity: number;
  zoom: number;
  aspectratio: number;
}

class camera {
  private options: cameraoptions;

  constructor(options: cameraoptions) {
    this.options = options;
  }

  update() {
    const { position, rotation, speed, sensitivity, zoom, aspectratio } = this.options;

    // handle camera movement based on user input
    const mousemovement = vec2.sub(vec2.create(), mouse.getposition(), mouse.getlastposition());
    const sensitiverotation = vec3.fromvalues(
      mousemovement.x * sensitivity,
      mousemovement.y * sensitivity,
      0
    );
    vec3.add(position, position, vec3.scalem(sensitiverotation, speed));
    vec3.add(rotation, rotation, sensitiverotation);

    // handle zoom
    const mousewheel = mouse.getdeltay();
    zoom += mousewheel * 0.01;
    zoom = clamp(zoom, 0.1, 10);

    // calculate view matrix based on camera position and rotation
    const viewmatrix = mat4.lookat(
      vec3.add(position, vec3.fromvalues(0, 0, zoom)),
      vec3.add(vec3.fromvalues(0, 0, -zoom), position),
      vec3.fromvalues(0, 1, 0)
    );

    // calculate projection matrix based on aspect ratio
    const projectionmatrix = perspective(
      deg2rad(45),
      aspectratio,
      0.1,
      100
    );

    // return updated view and projection matrices
    return { viewmatrix, projectionmatrix };
  }
}

export default camera;
```

this code defines a `camera` class with an options object that contains the camera's position, rotation, speed, sensitivity, zoom, and aspect ratio. The `update()` method of the class handles user input and updates the camera's position and rotation based on it. It also calculates the view and projection matrices based on the camera's position and rotation, and returns them as an object.

this is just a basic example, and you can customize the implementation based on your specific requirements. You can also expose parts of the `camera` class as methods for the end user to interact with, such as a `zoom()` method that adjusts the camera's zoom level or a `rotate()` method that rotates the camera based on user input.

