```
List<Transaction> transactions = [
  Transaction(coinName: 'BTC', datetime: DateTime(2021, 1, 1), profitEarnedLoss: 100),
  Transaction(coinName: 'ETH', datetime: DateTime(2021, 1, 2), profitEarnedLoss: 50),
  Transaction(coinName: 'LTC', datetime: DateTime(2021, 1, 3), profitEarnedLoss: 200),
