import java.util.Scanner;

public class MagneticFieldAnalyzer {

   public static void main(String[] args) {
      Scanner input = new Scanner(System.in);
      System.out.print("Enter the number of locations: ");
      int numLocations = input.nextInt();

      double[] magneticFieldIntensities = new double[numLocations];
      double[] latitudes = new double[numLocations];
      double[] longitudes = new double[numLocations];

      System.out.print("Enter location 1, latitude, longitude, and magnetic field intensity: ");
      for (int I = 0; I < numLocations; i++) {
         double lat = input.nextDouble();
         double lon = input.nextDouble();
         double magneticField = input.nextDouble();
         magneticFieldIntensities[i] = magneticField;
         latitudes[i] = lat;
         longitudes[i] = lon;
      }

      double totalMagneticFieldIntensity = 0;
      for (int I = 0; I < numLocations; i++) {
         totalMagneticFieldIntensity += magneticFieldIntensities[i];
      }

      double averageMagneticFieldIntensity = totalMagneticFieldIntensity / numLocations;
      System.out.println("Average magnetic field intensity: " + averageMagneticFieldIntensity);

      double sumSquaredMagneticFieldIntensities = 0;
      for (int I = 0; I < numLocations; i++) {
         double squaredMagneticFieldIntensity = magneticFieldIntensities[i] * magneticFieldIntensities[i];
         sumSquaredMagneticFieldIntensities += squaredMagneticFieldIntensity;
      }

      double standardDeviation = Math.sqrt(sumSquaredMagneticFieldIntensities / numLocations);
      System.out.println("Standard deviation of magnetic field intensities: " + standardDeviation);

      double maxMagneticFieldIntensity = magneticFieldIntensities[0];
      for (int I = 0; I < numLocations; i++) {
         if (magneticFieldIntensities[i] > maxMagneticFieldIntensity) {
            maxMagneticFieldIntensity = magneticFieldIntensities[i];
         }
      }

      double minMagneticFieldIntensity = magneticFieldIntensities[0];
      for (int I = 0; I < numLocations; i++) {
         if (magneticFieldIntensities[i] < minMagneticFieldIntensity) {
            minMagneticFieldIntensity = magneticFieldIntensities[i];
         }
      }

      System.out.println("Maximum magnetic field intensity: " + maxMagneticFieldIntensity);
      System.out.println("Minimum magnetic field intensity: " + minMagneticFieldIntensity);

      System.out.println("Location, Latitude, Longitude, Magnetic Field Intensity");
      for (int I = 0; I < numLocations; i++) {
         System.out.println(i+1 + ", " + latitudes[i] + ", " + longitudes[i] + ", " + magneticFieldIntensities[i]);
      }
   }
}
```

This code prompts the user to enter the number of locations and the latitude, longitude, and magnetic field intensity for each location. It then calculates the total magnetic field intensity, average magnetic field intensity, standard deviation of magnetic field intensities, maximum and minimum magnetic field intensities, and outputs the data in a table format. 

Note that this code can handle data with any number of locations, but if you have a large dataset, you may need to optimize the code for performance. Additionally, you may need to modify the code to work with different data formats or to perform additional analyses.

