Here's an example of how you can add IDs to the HTML elements and use the `React.useRef()` hook to retrieve the IDs:

```jsx
const CreateObjectView = observer(({ model }: { model: CreateObjectModel }) => {
  const assetRef = React.useRef<HTMLSelectElement>(null);
  const cleanupSceneRef = React.useRef<HTMLButtonElement>(null);

  const handleAssetChange = (event: React.ChangeEvent<HTMLSelectElement>) => {
    const value = event.target.value;
    if (value) {
      model.createObject(value).then();
      model.setSelectedAsset(value);
    }
