  return (
    <div>
      <select id="asset-select" ref={assetRef} onChange={handleAssetChange}>
        {model.availableAssets.map(asset => (
          <option key={asset.id} value={asset.id}>
            {asset.name}
          </option>
        ))}
      </select>

      <button id="cleanup-scene-button" ref={cleanupSceneRef} onClick={handleCleanupSceneClick}>
        Cleanup scene
      </button>
    </div>
  );
});
